issue.body:
### What did you expect to happen?

I set up Atuin on a new machine by copying an old config (v2 records sync enabled) and it unfortunately had a root partition that wasn't expanded yet and thus very close to full. I started the usual `atuin sync` which errored out mid way due to running out of disk space.

After fixing the partition issue I ran an `atuin sync -f` expecting this to fetch the missing records.

### What happened?

Syncing with or without force was unable to retrieve the missing history and only retrieved recent changes. Everything "seemed" consistent, just with a much shorter history.

Deleting `history.db` zeroed the locally available history, but even then a sync did not retrieve any history, not the old one or the newer I had just deleted. Only after deleting `records.db` can I actually truly do a forced sync that retrieves the entire history.

### Atuin doctor output

```yaml
This was run just before deleting anything.


