**issue (complexity):** Consider refactoring the deeply nested figure and costume logic into a helper function to make the handler more readable and linear.

```markdown
You can collapse most of that nested ‚Äúfigure ‚Üí costume ‚Üí args ‚Üí stmt‚Äù logic into a small helper (or two) and make your handler body read almost top‚Äêto‚Äêbottom. For example:

```ts
// new helper
function buildChangeFigureStmts(
  figure: string,
  action: string,
  state: StateStore,
  settings: SettingsStore
): string[] {
  if (!state.figureRecord) return []

  const fullPath = getFigureID(state.figureRecord, state.figureLink, figure)
  if (!fullPath) return []

  const [figureID, costumeName] = fullPath.split('/')
  const charData = state.figureRecord[figureID]
  let costume = costumeName
    ? charData?.costumes?.find(c => c.name === costumeName)
    : undefined
  costume ||= getDefaultCostume(charData?.costumes)
  if (!costume) return []

  const file = costume.path
  const act = findAction(state.actionLink, action) 
            || settings.figureDefaultAction
            || 'idle'
  const motion = getFigureAction(costume.motions ?? [], act)
  const expr   = getFigureAction(costume.expressions ?? [], act)

  const args = { id: figureID, transform: settings.figureDefaultTransform, next: '', motion, expression: expr }
  const argStr = Object.entries(args)
    .filter(([,v]) => v != null && v !== '')
    .map(([k,v]) => buildArg(k, v!))
    .join(' ')

  const stmt = `changeFigure: ${file} ${argStr}`
  return settings.dialogueAssociateFigure
    ? [stmt, `-id -figureId=${figureID}`]
    : [stmt]
}
```

Then your handler shrinks to:

```ts
handle: (stmt: DialogueStatement) => {
  const state    = useStateStore()
  const settings = useSettingsStore()
  const { ËßíËâ≤: figure, Âä®‰Ωú: action, ÂØπËØù: dialogue } = stmt

  // 1) build dialogue text
  const text = settings.removeTrailingPeriodInDialogue
    ? dialogue.replace(/„ÄÇ$/, '')
    : dialogue

  // 2) collect changeFig stmts
  const changeStmts = buildChangeFigureStmts(figure, action, state, settings)

  // 3) combine
  return [
    ...changeStmts,
    `${figure}: ${text}`
  ]
}
```

This preserves every feature, but removes the deep nesting and makes each step self‚Äêcontained.

</details>

