```rust
fn is_exp_json(path: &Path) -> bool {
    path.file_name()
        .and_then(|n| n.to_str())
        .map(|s| s.ends_with(".exp.json"))
        .unwrap_or(false)
}

fn collect_skip_dirs(dir: &Path) -> Result<HashSet<PathBuf>, String> {
    let mut skip = HashSet::new();
    for entry in glob(&format!("{}/**/*.jsonl", dir.display()))
        .map_err(|e| format!("glob error: {}", e))? 
    {
        let p = entry.map_err(|e| format!("walk error: {}", e))?;
        skip.insert(p.parent().unwrap_or(dir).to_path_buf());
    }
    Ok(skip)
}

fn get_json_files(dir: &Path) -> Result<Vec<PathBuf>, String> {
    let skip = collect_skip_dirs(dir)?;
    glob(&format!("{}/**/*.{json,jsonl}", dir.display()))
        .map_err(|e| format!("glob error: {}", e))?
        .filter_map(|entry| {
            let p = entry.ok()?;
            let ext = p.extension()?.to_str()?;
            if ext == "jsonl" {
                Some(p)
            } else if ext == "json" && !is_exp_json(&p) && !skip.iter().any(|d| p.starts_with(d)) {
                Some(p)
            } else {
                None
            }
        })
        .collect::<Vec<_>>()
        .pipe(Ok)
}
```

